pragma solidity 0.8.23;

import "wormhole-solidity-sdk/interfaces/IWormhole.sol";
import {ERC20} from "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";
import {Ownable2Step} from "@openzeppelin/contracts/access/Ownable2Step.sol";
import {Pausable} from "@openzeppelin/contracts/utils/Pausable.sol";

contract MigrateFLX is Ownable2Step, Pausable {
    /* =================================================== */
    /*                      STRUCTS                        */
    /* =================================================== */
    struct MigrateFLXMessage {
        // unique identifier for this migration
        // the Ethereum address of the caller
        address caller;
        // the SEDA chain address of the caller to receive the migrated tokens
        bytes32 sedaAddress;
        // the amount of tokens to be migrated
        uint256 amount;
    }

    /* =================================================== */
    /*                       ERRORS                        */
    /* =================================================== */
    /// Insufficient value for Wormhole Fee. Needed `required` but only
    /// `sent` amount was available.
    /// @param sent sent value.
    /// @param required required fee by Wormhole contracts.
    error IncorrectValueAmount(uint256 sent, uint256 required);

    /// TransferFrom failed.
    error TransferFromFailed();

    /* =================================================== */
    /*                       EVENTS                        */
    /* =================================================== */
    /// Emitted when a given amount of FLX is burned and a message is sent to the Wormhole network
    /// @param migrateId The unique identifier for this migration
    /// @param caller The Ethereum address of the caller
    /// @param sedaAddress The SEDA chain address of the caller to receive the migrated tokens
    /// @param amount The amount of tokens to be migrated
    event MigrateFLXMessagePublished(
        uint32 indexed migrateId, address indexed caller, bytes32 indexed sedaAddress, uint256 amount
    );

    /* =================================================== */
    /*                  STATE VARIABLES                    */
    /* =================================================== */
    address constant BURN_ADDRESS = 0x000000000000000000000000000000000000dEaD;
    uint32 public migrateId;
    address public immutable token;
    address public immutable wormholeCore;
    uint8 public immutable wormholeFinality;

    /// @param _token The address of the token to be migrated (i.e. EVM_TOKEN_ADDRESS)
    /// @param _wormholeCore The address of the Wormhole core contract
    /// @param _wormholeFinality The number of block confirmations needed before the wormhole network will attest a message
    /// @param _owner The address of the initial owner of this contract
    constructor(address _token, address _wormholeCore, uint8 _wormholeFinality, address _owner) Ownable(_owner) {
        token = _token;
        wormholeCore = _wormholeCore;
        wormholeFinality = _wormholeFinality;
    }

    /// @notice Burns a specified amount of tokens then sends a message to wormhole
    /// @param amount The amount of tokens to be migrated
    /// @param sedaAddress The SEDA chain address of the caller to receive the migrated tokens
    function migrate(uint256 amount, bytes32 sedaAddress)
        public
        payable
        whenNotPaused
        returns (uint64 messageSequence)
    {
        IWormhole wormhole = IWormhole(wormholeCore);
        uint256 wormholeFee = IWormhole(wormholeCore).messageFee();

        // require correct wormhole fee to be attached
        if (msg.value != wormholeFee) {
            revert IncorrectValueAmount({sent: msg.value, required: wormholeFee});
        }

        // perform state changes first
        migrateId++;

        // execute interactions (i.e. burn the tokens)
        bool success = ERC20(token).transferFrom(msg.sender, BURN_ADDRESS, amount);
        if (!success) {
            revert TransferFromFailed();
        }

        // create the MigrateFLX struct
        MigrateFLXMessage memory message =
            MigrateFLXMessage({caller: msg.sender, sedaAddress: sedaAddress, amount: amount});

        // emit the event
        emit MigrateFLXMessagePublished(migrateId, msg.sender, sedaAddress, amount);
        messageSequence = wormhole.publishMessage{value: wormholeFee}(migrateId, abi.encode(message), wormholeFinality);

        // return Wormhole message sequence
        return messageSequence;
    }

    /* =================================================== */
    /*            EVM_EMITTER_CONTRACT_OWNER-ONLY          */
    /* =================================================== */
    /// @notice Pauses the contract
    function pause() external onlyOwner {
        _pause();
    }

    /// @notice Unpauses the contract
    function unpause() external onlyOwner {
        _unpause();
    }
}
